import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: 'app.component.html',
  styleUrls: ['app.component.scss'],
})
export class AppComponent {
  constructor() {}
}
<ion-content>
  <ion-list>
    <ion-item (click)="shareOnFacebook()">Facebook</ion-item>
    <ion-item (click)="shareOnTwitter()">Twitter</ion-item>
    <!-- Add more social media options as needed -->
  </ion-list>
</ion-content>
